import React, { useState } from 'react'
import styled from 'styled-components'
import { Button, Typography, Container, Avatar } from '@material-ui/core';
import Icons from '@material-ui/core/Icon'
import axios from 'axios'

const Background = styled(Container)`
    padding: unset;
    width: 250px;
    margin: initial;
    padding: 0px;
    width: 250px;
    margin: initial;
    &:hover {
        border-bottom: 7px solid #ed565d;
        cursor: pointer;
        color: #ed565d;
    }
`

const InfoPanel = styled(Container)`
    padding: unset;
    display: flex;
    align-items: center;
    color: black;
`

const Image = styled(Avatar)`
    width: fit-content;
    height: 350px;
    border-radius: 0px;
`

const Title = styled(Typography)`
    padding: 5px 0px 0px 0px;
    text-overflow: ellipsis;
    white-space: nowrap;
    overflow: hidden;
    font-size: 0.9rem;
`

const Icon = styled(Icons)`
    font-size: 1.2rem;
`

const Availability = styled(Typography)`
    margin: auto;
`

const Rate = styled(Container)`
    display: flex;
    align-items: center;
    width: fit-content;
    padding: unset;
    margin: initial;
`

const RateText = styled(Typography)`
    width: fit-content;
    min-width: 40px;
    max-width: 40px;
    text-align: center;
`

const RateButton = styled(Button)`
    min-width: 35px;
    &:focus {
        color: #ed565d;
    }
`

const MoreButton = styled(Button)`
    margin-left: auto;
    font-size: 2.0rem;
    min-width: 40px;
`

export default function BookCard(props) {

    props = data

    const getUsedBooks = () => {
        axios
            .get(`api/book/users/reading/${props.id}`)
            .then((response) => {
                setUsedBooks(response.data.length)
            })
    }

    const [usedBooks, setUsedBooks] = useState(null)

    getUsedBooks()

    const [available, setAvailable] = useState(props.amount > usedBooks ? true : false)
    

    return (
        <Background>
            <Image src={`data:image/${props.type};base64, ${props.data}`} />
            <Title>
                {props.name}
            </Title>
            <InfoPanel>
                <Rate>
                    <RateText>{props.likes}</RateText>
                    <RateButton>
                        <Icon>
                            {'thumb_up'}
                        </Icon>
                    </RateButton>
                </Rate>
                <Rate>
                    <RateText>{props.dislikes}</RateText>
                    <RateButton>
                        <Icon>
                            {'thumb_down'}
                        </Icon>
                    </RateButton>
                </Rate>
                <Availability style={{color: available ? "green" : "red"}}>
                    {`${usedBooks}/${props.amount}`}
                </Availability>
                <MoreButton>
                    <Icons>
                        {'more_horiz'}
                    </Icons>
                </MoreButton>
            </InfoPanel>
        </Background>
    )
}


